import { useState } from "react";
import { ToastContainer, toast } from "react-toastify";
import { useNavigate } from "react-router-dom";

const AddLodgeForm = () => {
  const [type, setType] = useState("");
  const [description, setDescription] = useState("");

  const admin_jwtToken = sessionStorage.getItem("admin-jwtToken");

  let navigate = useNavigate();

  const saveLodge = (e) => {
    e.preventDefault();
    let data = { type, description };

    fetch("http://localhost:8080/api/lodge/add", {
      method: "POST",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
        // Authorization: "Bearer " + admin_jwtToken,
      },
      body: JSON.stringify(data),
    })
      .then((result) => {
        result.json().then((res) => {
          if (res.success) {
            toast.success(res.responseMessage, {
              position: "top-center",
              autoClose: 1000,
              hideProgressBar: false,
              closeOnClick: true,
              pauseOnHover: true,
              draggable: true,
              progress: undefined,
            });

            setTimeout(() => {
              navigate("/home");
            }, 2000); // Redirect after 3 seconds
          } else {
            toast.error(res.responseMessage, {
              position: "top-center",
              autoClose: 1000,
              hideProgressBar: false,
              closeOnClick: true,
              pauseOnHover: true,
              draggable: true,
              progress: undefined,
            });
          }
        });
      })
      .catch((error) => {
        console.error(error);
        toast.error("It seems server is down", {
          position: "top-center",
          autoClose: 1000,
          hideProgressBar: false,
          closeOnClick: true,
          pauseOnHover: true,
          draggable: true,
          progress: undefined,
        });
      });
  };

  return (
    <div className="d-flex justify-content-center align-items-center mt-5">
      <div className="form-card" style={{ width: "100%", maxWidth: "500px" }}>
        <div className="card-header bg-color custom-bg-text mt-2">
          <h5 className="card-title">Add Lodge</h5>
        </div>
        <div className="card-body text-color">
          <form onSubmit={saveLodge}>
            <div className="mb-3">
              <label htmlFor="title" className="form-label">
                <b>Lodge Name</b>
              </label>
              <input
                type="text"
                className="form-control custom-input"
                id="title"
                placeholder="Enter title..."
                onChange={(e) => setType(e.target.value)}
                value={type}
                required
              />
            </div>

            <div className="mb-3">
              <label htmlFor="description" className="form-label">
                <b>Lodge Description</b>
              </label>
              <textarea
                className="form-control custom-input"
                id="description"
                rows="3"
                placeholder="Enter description..."
                onChange={(e) => setDescription(e.target.value)}
                value={description}
                required
              />
            </div>

            <div className="d-flex justify-content-center mb-2">
              <button
                type="submit"
                className="btn custom-btn"
                style={{ padding: "10px 25px", borderRadius: "5px", cursor: "pointer" }}
              >
                Add Lodge
              </button>
            </div>

            <ToastContainer />
          </form>
        </div>
      </div>

      <style jsx>{`
        .form-card {
          border-radius: 10px;
          border: 1px solid #ccc;
          padding: 20px;
          box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
        }

        .card-header {
          background-color: #f8b400;
          color: white;
          text-align: center;
          padding: 10px;
          border-radius: 8px 8px 0 0;
        }

        .card-body {
          background-color: #f9f9f9;
          padding: 20px;
          border-radius: 0 0 8px 8px;
        }

        .form-label {
          font-weight: 500;
          font-size: 1.1rem;
        }

        .form-control {
          border-radius: 5px;
          padding: 10px;
          font-size: 1rem;
          transition: all 0.3s ease;
        }

        .form-control:focus {
          border-color: #f8b400;
          box-shadow: 0 0 10px rgba(248, 180, 0, 0.4);
        }

        .custom-input {
          border: 1px solid #ddd;
        }

        .custom-btn {
          background-color: #f8b400;
          border: none;
          color: white;
          font-size: 1.1rem;
          font-weight: 600;
          transition: all 0.3s ease;
        }

        .custom-btn:hover {
          background-color: #e1a100;
          transform: translateY(-2px);
        }

        .custom-btn:active {
          background-color: #c88f00;
        }

        /* Add hover effect on input fields */
        .form-control:hover {
          border-color: #f8b400;
        }

        /* Center form on the screen */
        .d-flex {
          display: flex;
          justify-content: center;
          align-items: center;
          height: 100vh;
        }

        /* Card style */
        .card-body {
          padding: 20px;
        }

        /* Responsive layout for smaller screens */
        @media (max-width: 576px) {
          .form-card {
            width: 90%;
          }

          .card-header {
            font-size: 1.1rem;
          }
        }
      `}</style>
    </div>
  );
};

export default AddLodgeForm;
